import React, { useState } from 'react';
import './App.css';
import DailyToDo from './DailyToDo'
import ToDoList from './ToDoList'
import { Container, Row, Col } from 'react-bootstrap';

const WeeklyToDo = () => {
  const [toDoLists, setToDoLists] = useState<typeof ToDoList[]>([])

  return (
    <Container>
      <div className="weeklyPlanner">
        <h3 className="dayname">Monday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Tuesday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Wednesday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Thursday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Friday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Saturday</h3>
        <DailyToDo></DailyToDo>
        <h3 className="dayname">Sunday</h3>
        <DailyToDo></DailyToDo>
      </div>
    </Container>
  );
}

export default WeeklyToDo;
